/*eslint-disable*/

function Campaign(props) {
  const type = props.typeSelect;

  const style = {
    background: "orange",
    height: "400px",
  };

  const bannerStyle = {
    resizeMode: "cover",
    width: "90%",
  };
  return (
    <div style={style}>
      <img src="image/banner.png" style={bannerStyle}></img>
    </div>
  );
}

export default Campaign;
